    "fort-niobrara-national-wildlife-refuge-narrative-report-jan-1-1944-to-april-30-1944",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1944. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and raptors- is also
    covered. The Refuge development and maintenance section discusses physical developments
    and plantings. Resource management is outlined; topics include haying and fur harvesting.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
